field_event_description:
  -
    value: "<p>National Museum is Sweden's museum of art and design. <strong>After five years</strong> of renovation and refurbishment, the museum is open again to the public. How about visiting it? Some Alumni residing in Stockholm are going to have this tour, and you are all invited. That's not all:&nbsp;it happens to be free -&nbsp;yes, free! -&nbsp;so you just need to show up at the designated hour :)<br />\r\nThis will be particularly exciting for Alumni working with / interested in design. Vi ses alla där :)</p>\r\n\r\n<p>Feel free to contact&nbsp;<a href=\"https://alumni.eitdigital.eu/users/gigiho\">Gigi Ho</a>&nbsp;for more information!</p>\r\n"
